Quarantine and face mask life is weird but in the woods there’s that energy and pace... not ours, but the planet’s - and I needed that battery reset. 

I’m winding down my last few weeks in the Adirondacks here - the leaves are starting to change and so is my life. The great turning into a desert botanist - no more east coast life for me. What a trip it’s all been. I’m so grateful each day to be where I am and how I am. Life is good. #adirodacks #backpacking #cranberrylake #eastcoast #northcountry";}i:212;a:1:{s:14:"comments_count";i:0;}i:213;a:1:{s:11:"likes_count";i:0;}i:214;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEuvnISlZKs";}i:215;a:1:{s:5:"image";s:249:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/s1080x1080/118730264_186838432884446_7616292293324124869_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=102&_nc_ohc=WOz-s_0sfpsAX8KaMHC&oh=91629a5040e1775877a62512f80d998b&oe=5F7D7889";}i:216;a:1:{s:4:"type";s:5:"image";}i:217;a:1:{s:8:"owner_id";i:12167902870;}i:218;a:1:{s:14:"owner_username";s:0:"";}i:219;a:1:{s:14:"owner_fullname";s:0:"";}i:220;a:1:{s:9:"owner_pic";s:0:"";}i:221;a:1:{s:2:"id";s:19:"2391057597552018635";}i:222;a:1:{s:10:"short_code";s:11:"CEuvjdzlkTL";}i:223;a:1:{s:12:"created_time";i:1599256299;}i:224;a:1:{s:7:"caption";s:1387:"This photo is from a couple of weeks ago, but it still makes me so happy. I worked my butt off on this map while I was lacking work earlier this year - my weekend passion project turned full-time hobby (thanks to ‘rona) - and I still look back thinking, “I made that?” 🤔 It’s all a blur because of everything I was struggling with at the time, but this kept my mind and body busy as hell. I’ve so badly wanted to get back to my art roots... and at some point, leave a mark somehow. So I set out to create something that was meaningful not only to me, but to many.
.
Seeing this gigantic archival snapshot of history that’ll outlive all of us, that I hand-drew, hanging on the wall at one of my absolute favorite places in America’s Hometown... it makes me feel like I actually did it. I feel so much pride for it, and those are hard words for me to find sometimes. The fact that the Su Casa fam immediately understood what I was going for and invested in this beautiful framed piece means so much to me. I’m incredibly grateful for them, and for everyone who has bought a print since I opened my shop.
.
You probably know what I’m gonna say next, but... if you haven’t been to @sucasaplymouth ... GO! Tell them Kat and Josh sent you. Everything about them is dope, I promise. 🙌
.
And if you’d like your own print, they’re available on katevansart.com ☺️";}i:225;a:1:{s:14:"comments_count";i:1;}i:226;a:1:{s:11:"likes_count";i:2;}i:227;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEuvjdzlkTL";}i:228;a:1:{s:5:"image";s:249:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/s1080x1080/118762884_175175770745864_3890588996688944866_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=108&_nc_ohc=k5tDITwtNBsAX8118zW&oh=7c6fde597b475f11e3592999e866d964&oe=5F7C103F";}i:229;a:1:{s:4:"type";s:7:"sidecar";}i:230;a:1:{s:8:"owner_id";i:19403767;}i:231;a:1:{s:14:"owner_username";s:0:"";}i:232;a:1:{s:14:"owner_fullname";s:0:"";}i:233;a:1:{s:9:"owner_pic";s:0:"";}i:234;a:1:{s:2:"id";s:19:"2391052974085468633";}i:235;a:1:{s:10:"short_code";s:11:"CEuugL3gXHZ";}i:236;a:1:{s:12:"created_time";i:1599256296;}i:237;a:1:{s:7:"caption";s:514:"Footprints left behind. So many visitors, yet not a soul to be seen...

